import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  <div className={s.dialog + " " + s.active}>
    <NavLink to="/dialogs/1">Viktor</NavLink>
  </div>;
};

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogItems}>
        <DialogItem adress="/dialogs/1" username="Viktor" />
        <div className={s.dialog}>
          <NavLink to="/dialogs/3">Alex</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/2">John</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/4">Frank</NavLink>
        </div>
        <div className={s.dialog}>
          <NavLink to="/dialogs/5">Maxym</NavLink>
        </div>
      </div>
      <div className={s.messages}>
        <div className={s.message}>Hi</div>
        <div className={s.message}>How are you doing today?</div>
        <div className={s.message}>All good. How about you?</div>
      </div>
    </div>
  );
};

export default Dialogs;
